import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { SearchView } from "./view/SearchView";
import { HarvardManagementDocuments } from "./view/controls/HarvardManagementDocuments";
import { useConfigContext } from "./contexts/ConfigurationContext";
import { SearchContextProvider } from "./contexts/SearchContext";
import { ConfigContextProvider } from "./contexts/ConfigurationContext";
import "./App.scss";

const AppRoutes = () => {
  const { app } = useConfigContext();
  document.title = app.title ?? "Columbia Threadneedle Search";

  return (
    <Router>
      <SearchContextProvider>
        <Routes>
          <Route path="/" element={<SearchView />} />
          <Route path="/harvard-management" element={<HarvardManagementDocuments />} />
        </Routes>
      </SearchContextProvider>
    </Router>
  );
};

export const App = () => (
  <ConfigContextProvider>
    <AppRoutes />
  </ConfigContextProvider>
);
